import axios from "axios";
import { useEffect, useState } from "react";
import Approach from "./components/Approach";
import Clients from "./components/Clients";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Hero from "./components/Hero";
import Services from "./components/Services";

function App() {

  const [approach, setApproach] = useState([]);

  useEffect(() => {
    const approach = axios.get('http://localhost:1337/approaches?_locale=fr');
    const requestTwo = axios.get('http://localhost:1337/approaches?_locale=fr');
    const requestThree = axios.get('http://localhost:1337/approaches?_locale=fr');

    axios.all([approach, requestTwo, requestThree]).then(axios.spread((...responses) => {
      const responseOne = responses[0]
      const responseTwo = responses[1]
      const responesThree = responses[2]
      // use/access the results 

      setApproach({approaches: responseOne})

    })).catch(errors => {
      // react on errors.
    })

  }, []);

  return (
    <div className="container-fluid custom">
      {/* <code>{JSON.stringify(data)}</code> */}
      <Header />
      <Hero />
      <Approach approaches={approach.approaches}/>
      <Services />
      <Clients />
      <Footer />
    </div>
  );
}

export default App;
